/* 1083. List Grades (25) *//* 25/25 */#include<iostream>#include<vector>#include<algorithm>#include<string>using namespace std;typedef struct Student{	string name;	string id;	int grade;}Student;bool cmp(const Student &a,const Student &b){	return a.grade>b.grade;}int main(){	   freopen("D:\\in.txt","r",stdin);	int  n;	cin>>n;	vector<Student> vec;	vec.resize(n);	int cnt=0;	for(int i=0;i<n;i++)	{		cin>>vec[i].name>>vec[i].id>>vec[i].grade;	}	int max,min;	cin>>min>>max;	sort(vec.begin(),vec.end(),cmp);	for(int i=0;i<n;i++)	{		if(vec[i].grade<=max&&vec[i].grade>=min)		{			cout<<vec[i].name<<" "<<vec[i].id<<endl;			cnt++;		}		else if(vec[i].grade<min) break;	}	if(cnt==0) cout<<"NONE"<<endl;	return 0;}